import React from 'react';
import { StyledMenu } from './StyledMenu';

const Menu = ({open}) => {
  return (
    <StyledMenu open={open}>
      <a href="/story">
        Our Story 
      </a>
      <a href="#plants">
        Plants
        </a>
    </StyledMenu>
  )
}
export default Menu;
